import React, { Component } from "react";
import Conditional from "./Conditional";

class CreateMovie extends Component {
  constructor() {
    super();
    this.state = {
      isLoading: true,
      discover: {}
    };
  }

  async componentDidMount() {
    let res = await fetch("http://localhost:5000/discover/");
    this.setState({ discover: await res.json(), isLoading: false });
  }

  testFunc = () => {
    if (this.state.discover[0].length > 0) {
      console.log(this.state.discover[0].title);
    }
    //console.log(Object.keys(this.state.discover));
  };

  render() {
    return (
      <div>
        <Conditional isLoading={this.state.isLoading} />
        <p>Content: Discover page for new movies</p>
      </div>
    );
  }
}

export default CreateMovie;
